import Main from "./Main";
import Navbar from "./Navbar";
import Sidebar from "./Sidebar";


function Home() { 
return (
<div> 
    <Navbar/> 
    <div className="flex justify-between ">  
        /**  **/
    <Sidebar/> 
    <Main/> 
    </div>
    <Footer/> 
    
</div>
) ; 
}

export default Home ;
